var src1="data:image/jpeg;base64,";


window.onload = function(){
    var img1=document.querySelector("#img1");
    var img2=document.querySelector("#img2");
    img1.src =src1;
    $.post("retouche",{
        data: src1,
    }).done(
        function(data){
            if (data.status=="OK"){
		console.log(data.imgdata)
		img2.src=data.imgdata;
	    }
        }
    );
};
